import React, { Component, Fragment } from "react";
import QuickModel from "./QuickModel";

export default class showItems extends Component {
  state = {
    doc: [],
  };

  componentDidMount = (async) => {
    this.setState({ doc: this.props.doctor });
  };
  render() {
    console.log(this.props);
    return (
      <Fragment>
        <div
          className="col-lg-3 col-md-3 col-sm-3   animated fadeInUp wow animated"
          key={this.state.doc._id}
        >
          <div className="product-top">
            <img src={`${this.state.doc.image}`} className="img1" alt="" />
            <div className="product-bottom text-center">
              <h3>{this.state.doc.name}</h3>
              {/* <h4>{this.state.doc.specialization.catname}</h4> */}
              <h4>{this.state.doc.fees}</h4>

              <button
                type="button"
                className="btn btn-secondary"
                title="Quick Shop"
                data-toggle="modal"
                data-target="#quickModel"
              >
                Book Appointment
              </button>
            </div>
            <div className="overlay">
              <button
                type="button"
                className="btn btn-secondary"
                title="Quick Shop"
                data-toggle="modal"
                data-target="#quickModel"
              >
                <i className="fa fa-eye"></i>
              </button>

              <button
                type="button"
                className="btn btn-secondary"
                title="Add to Cart"
                data-toggle=""
                data-target=""
              >
                <i className="fa fa-shopping-cart"></i>
              </button>
            </div>
          </div>
          <div className="product-bottom text-center"></div>
        </div>
        <QuickModel doc={this.state.doc} key={this.state.doc._id}></QuickModel>
      </Fragment>
    );
  }
}
